import React, { useState } from 'react'
import Charts from 'react-apexcharts'

const CardGraph = () => {
    const [Data] = useState(
        {
           options : {
               series : [44, 55, 41, 17, 15],
               chartOptions: {
                labels: ['Apple', 'Mango', 'Orange', 'Watermelon']
                },
                chart:{
                    type:"donut"
                },
                dataLabels:{
                    enabled : true,
                    formatter: (value) =>
                    {
                        return value;
                    }
                },
                dropShadow:{
                    enabled: true,

                }
           }
        }
    )
    return (
        <div>
              <Charts options={Data.options} series={Data.series}  width="auto" type={'Pie'} />
        </div>
    )
}

export default CardGraph
